import { CHATLIST_URL, CHAT_URL } from "../utils/consts";
import { 
    // $host, 
    $authhost 
} from "./index";

export const chats = async () => {
    const result = await $authhost.get(CHATLIST_URL)
    return result
}
export const chat = async (chatId) => {
    const result = await $authhost.get(CHAT_URL + chatId)
    return result
}
